import React, {useState} from 'react'

export default props => {
	const [value, setValue] = useState([]);
	//const arrValue = [];
    const valueChangeHandler = (event, i) => {
    	debugger
        setValue(event.target.value)
    }

	return(
		<div className="form-inline">
		  <input type="text" className="form-control mb-2 mr-sm-2 col-1" id="inlineFormInput1" placeholder="ID" onChange={valueChangeHandler(event, 0)}/>
		  <input type="text" className="form-control mb-2 mr-sm-2" id="inlineFormInput2" placeholder="FirstName" onChange={valueChangeHandler(0)}/>
		  <input type="text" className="form-control mb-2 mr-sm-2" id="inlineFormInput3" placeholder="LastName" onChange={valueChangeHandler(0)}/>
		  <input type="text" className="form-control mb-2 mr-sm-2" id="inlineFormInput4" placeholder="Email" onChange={valueChangeHandler(0)}/>
		  <input type="text" className="form-control mb-2 mr-sm-2" id="inlineFormInput5" placeholder="Phone" onChange={valueChangeHandler(0)}/>

		  <button type="submit" className="btn btn-primary mb-2" onClick={() => props.addElem(value)}>Submit</button>
		</div>
	)
}
